import React, { useState } from 'react';
import { 
  FaCat, 
  FaDog, 
  FaDragon, 
  FaFish, 
  FaFrog, 
  FaHippo, 
  FaKiwiBird, 
  FaSpider 
} from 'react-icons/fa';

const iconMap = {
  Opening: FaCat,
  Closing: FaDog,
  Net: FaDragon,
  Assigned: FaFish,
  Expended: FaFrog,
};

const cardColors = {
  Opening: '#FF6F91',
  Closing: '#FF9671',
  Net: '#FFC75F',
  Assigned: '#00C9A7',
  Expended: '#845EC2',
};

const cuteIcons = {
  'Jan 2025': <FaKiwiBird />,
  'Feb 2025': <FaHippo />,
  'Mar 2025': <FaSpider />,
  'Apr 2025': <FaDragon />,
};

const colorPalette = ['#FF6F91', '#FF9671', '#FFC75F', '#00C9A7', '#845EC2', '#FF6F91'];

const Filter = ({ label, options, value, onChange }) => {
  return (
    <div className={`filter-group ${value ? 'selected' : ''}`} aria-label={label}>
      <label>{label}</label>
      <select
        value={value}
        onChange={e => onChange(e.target.value)}
        aria-label={label}
        style={{ borderColor: value ? '#ff4081' : 'transparent' }}
      >
        <option value="">Select {label}</option>
        {options.map((opt) => (
          <option key={opt} value={opt}>{opt}</option>
        ))}
      </select>
      {value && <span className="filter-icon">{cuteIcons[value]}</span>}
    </div>
  );
};

const DashboardCard = ({ id, title, icon: Icon, value, selected, onClick }) => {
  return (
    <div
      className={`card ${selected ? 'selected' : ''}`}
      onClick={() => onClick(id)}
      role="button"
      tabIndex={0}
      onKeyDown={e => { if (e.key === 'Enter') onClick(id); }}
      aria-pressed={selected}
      aria-label={title}
      style={{
        borderColor: selected ? cardColors[id] : 'transparent',
        boxShadow: selected
          ? `0 8px 30px ${cardColors[id]}, 0 0 15px ${cardColors[id]}`
          : '0 8px 32px rgba(0,0,0,0.2)'
      }}
    >
      <div className="card-header" style={{ color: selected ? cardColors[id] : '#fff' }}>
        <Icon className="icon" />
        <h3>{title}</h3>
      </div>
      <p className="value">{value}</p>
    </div>
  );
};

export default function App() {
  const [dateFilter, setDateFilter] = useState('');
  const [baseFilter, setBaseFilter] = useState('');
  const [equipFilter, setEquipFilter] = useState('');
  const [selectedCard, setSelectedCard] = useState(null);

  const openingBalance = 125000;
  const closingBalance = 143500;
  const purchases = 15000;
  const transferIn = 8000;
  const transferOut = 12000;
  const netMovement = purchases + transferIn - transferOut;
  const assignedAssets = 320;
  const expendedAssets = 45;

  const dateOptions = ['Jan 2025', 'Feb 2025', 'Mar 2025', 'Apr 2025'];
  const baseOptions = ['Base A', 'Base B', 'Base C'];
  const equipOptions = ['Type 1', 'Type 2', 'Type 3'];

  return (
    <div className="App" role="main">
      <h1 className="title">✨ Cute Asset Dashboard ✨</h1>

      <div className="filters" role="region" aria-label="Filters">
        <Filter label="Select Date" options={dateOptions} value={dateFilter} onChange={setDateFilter} />
        <Filter label="Select Base" options={baseOptions} value={baseFilter} onChange={setBaseFilter} />
        <Filter label="Equipment Type" options={equipOptions} value={equipFilter} onChange={setEquipFilter} />
      </div>

      <div className="dashboard" aria-label="Dashboard Key Metrics">
        <DashboardCard 
          id="Opening"
          title="Opening Balance" 
          icon={FaCat} 
          value={`$${openingBalance.toLocaleString()}`} 
          selected={selectedCard === 'Opening'}
          onClick={setSelectedCard}
        />
        <DashboardCard 
          id="Closing"
          title="Closing Balance" 
          icon={FaDog} 
          value={`$${closingBalance.toLocaleString()}`} 
          selected={selectedCard === 'Closing'}
          onClick={setSelectedCard}
        />
        <DashboardCard 
          id="Net"
          title="Net Movement" 
          icon={FaDragon} 
          value={`$${netMovement.toLocaleString()}`} 
          selected={selectedCard === 'Net'}
          onClick={setSelectedCard}
        />
        <DashboardCard 
          id="Assigned"
          title="Assigned Assets" 
          icon={FaFish} 
          value={assignedAssets} 
          selected={selectedCard === 'Assigned'}
          onClick={setSelectedCard}
        />
        <DashboardCard 
          id="Expended"
          title="Expended Assets" 
          icon={FaFrog} 
          value={expendedAssets} 
          selected={selectedCard === 'Expended'}
          onClick={setSelectedCard}
        />
      </div>
    </div>
  );
}
